INSERT INTO `email_template` (`email_template_id`, `title`, `subject`, `body`) VALUES
(1, 'Password Reset Email', 'Password Reset Successful', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]],\r\n<br><br>\r\nWe are here to help you whenever you feel the need!   \r\nYou recently requested us to reset the password to your account.\r\nbr/>\r\nYour password has been changed.\r\n<br>\r\nYour package is: [[package]]\r\n<br>\r\nYour new password is: [[password]]\r\n<br>\r\nPlease save it to remember. NOTE:  If you did not request a password to reset, please ignore this email.\r\n<br><br>\r\nGood luck with your search!\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nMatch Made In Jannah\r\n<br>\r\nBoard Members\r\n<br>\r\nMon-Fri., 9am-3pm)\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n<br><br>\r\nps:  Please, do not reply to this message.\r\n<br>\r\n'),
(2, 'Package Purchase Successful', 'Platinum Purchase ', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]]:\r\n<br><br>\r\nThank you for purchasing the Platinum Package with Match Made In Jannah, we are thrilled to have you aboard with us!  \r\n<br><br>\r\nYou are now registered and can continue to start the search.  We offer a database consisting of all age brackets, professions, residence, and citizenship.  We also offer both a Video & Picture upload which is totally optional.  However, many members find that the early establishment of physical attraction is important in their search for a spouse, you may find that your profile generates more interest with a photo.\r\n<br><br>\r\nLastly, please be committed to your search and believe in yourself. May Allah (S) help and guide you to find your soulmate.\r\n<br><br>\r\nThe Messenger of Allah (S) has said, \"There is no foundation that has been built in Islam more loved by Allah, (The Greatest and Noblest) than marriage.\"\r\n<br><br>\r\nWhen a man marries he indeed perfects half of his religion, then he should fear Allah for the remaining half.  (Bukhari)\r\n<br><br>\r\nPlease check the invoice in your profile under my account and billing.\r\n<br><br>\r\nGood luck, our blessings and prayers are with you!\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\n(248) 934-0075\r\n<br>\r\nMon-Fri, 9am-3pm)\r\n<br><br>\r\nps:  Please, do not reply to this message.\r\n<br>'),
(4, 'Account Opening Email', 'Verification Email', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]],\r\n<br><br>\r\nThank you for registering with Match Made In Jannah!\r\n<br><br>\r\nTo proceed please verify your email by clicking on the following link:\r\n<br>\r\n<a href=\"[[base_url]]home/email_verification/[[member_id]]\"><b><u>Click Here</u></b></a>\r\n<br><br>\r\nIf you did not create this account, kindly ignore this request.\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\n(248) 934-0075\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n<br>\r\nMon-Fri., 9am-3pm\r\n<br><br>\r\nps:  Please do not reply to this message.\r\n\r\n'),
(5, 'Staff Account Add Email', 'New Staff Account', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]],\r\n<br><br>\r\nYou have been Added [[sitename]] as Staff.\r\n<br>\r\nYour account role is : [[role_type]]\r\n<br>\r\nEmail is : [[email]]\r\n<br>\r\nPassword is : [[password]]\r\n<br>\r\nYou will be able to login from here : [[url]]\r\n<br><br>\r\nPlease contact with the administration team if you have any further question. Best wishes.\r\n<br><br>\r\nThanks,\r\n<br><br>\r\n[[from]]'),
(6, 'Deleted Member Email', 'Account Deleted', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br/><br/>\r\nDear [[to]]\r\n<br/><br/>\r\nWe pray that you are doing well by the grace of Allah!\r\n<br/><br/>\r\nWe truly hope you enjoyed your search with us.  We hope and pray that you found success through us and wish you all the happiness.    \r\n<br/><br/>\r\nIf our services have brought you success, please share your story with us. At the present time, we are offering all members who have found success to share their stories with a brief description.  Please write to success@matchmadeinjannah.com.  \r\n<br/><br/>\r\nIf you wish to display your Photo(s) on our home screen of your new-found, \"Match Made In Jannah\".  Please let us know which display you are interested in getting.\r\n<br/><br/>\r\n	1.  Home Screen display 1 Photo  -  1 week =  $  50.00\r\n	2.  Home Screen display 2 Photos - 2 weeks = $100.00\r\n<br/><br/>\r\nFinally, we truly value your opinion, so please feel free to leave us any feedback with comments, compliments, or suggestions at customers@matchmadeinjannah.com, so we can continue to improve our services.\r\n<br/><br/>\r\nMay Allah\'s’ blessings be always upon you!\r\n<br/><br/>\r\nSincerely,\r\n<br/><br/>\r\nBoard Members\r\n<br/>\r\nmatchmadeinjannah.com\r\n<br/>\r\n(248) 934-0075\r\n<br/><br/>\r\nMon-Fri., 9am-3pm)\r\n<br/>\r\nps:  Please, do not reply to this message. \r\n<br/>\r\n'),
(7, 'No Picture Email', 'No Photo', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]],\r\n<br><br>\r\nThank you for registering with Match Made In Jannah!  \r\n<br><br>\r\nWe have noticed that you have NOT uploaded any photo(s).  Uploading your photo/video is completely optional. However, many members find early establishment of physical attraction very important in their search for a spouse, you may find that your profile generates less interest without a photos/video.  \r\n<br><br>\r\nOnce you upload a photo/video it will either be approved or rejected within 24   hours.   If you are not able to view your photo/video within 24hrs. it is probably because: a. We have a lot of registrants to screen b. You didn’t follow the photo criteria. \r\nbr/><br>\r\nFor quick assistance, please call us at (248) 934-0075.  May Allah help you to find your partner through us. \r\n<br><br>\r\nAlso, take advantage of our new VIDEO feature as well !\r\n</center>                                           \r\nCriteria to upload Photo(s)/Video\r\n</center>\r\n<br>\r\n<table border=\"1\">\r\n<tr>\r\n<td>\r\nPHOTO(S)\r\n</td>\r\n<td>\r\nAll Photos must be in color, close up, clear, bright, try not to have others in the picture, NO side profiles please, and all photos must be recent (1-3months).<br>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\nVIDEO \r\n</td>\r\n<td>\r\nAll Videos should be no longer than 30 sec. or less, please show both close-up and far views of yourself in a well-lit room.  When recording, say your: first Name ONLY,  Age, Profession, State, and a brief description of self as well as spouse preference. Please make sure you are the  ONLY person in the video.\r\n<br>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\nSCREENING\r\n</td>\r\n<td>\r\nOnce you upload a photo/video it will either be approved or rejected within 24   hours.   If you are not able to view your photo/video within 24hrs. it is probably because: a. We have a lot of registrants to screen b. You didn’t follow the photo criteria.  You should receive a notice of criteria to follow within 1 week.  So please bear with us patiently, we will process it as soon as possible.  \r\n<br>\r\n</td>\r\n</tr>\r\n</table>\r\n\r\nThe screening process is done only by our administrators, they are the ones who have access to all photos/videos and profiles, whom you have granted access to. Male administrators view male registrants & female administrators view female registrants.  All photos/video and profile remain completely private.  Please make sure your dress & language are appropriate for your profile to be \r\nscreened by others.  \r\n<br><br>\r\nGood luck, you can continue to look at members, while your profile is being screened.\r\n<br>\r\nSo join the rest to find your best !\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n(248) 934-0075\r\n<br>\r\n(Mon-Fri., 9am-3pm)\r\n<br>\r\nps:  Please, do not reply to this message. \r\n<br>'),
(8, 'Incomplete Profile Email', 'Incomplete Profile', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br/><br/>\r\nDear [[to]]:\r\n<br/><br/>\r\nThank you for registering with Match Made In Jannah, we are thrilled to have you aboard with us!\r\n<br/><br/>\r\nWe have noticed that your profile is incomplete. Members who are seriously seeking for a partner want to see full details so that they get a better idea of compatibility. So, please take the time to complete your profile, and let us know how your search is going.\r\n\r\nIf you have any questions, please contact us.\r\n<br/><br/>\r\nGood luck with your search!\r\n<br/><br/>\r\nSincerely,\r\n<br/><br/>\r\nBoard Members\r\n<br/>\r\nmatchmadeinjannah.com\r\n<br/>\r\n(248) 934-0075\r\n<br/>\r\ncustomers@matchmadeinjannah.com\r\n<br/>\r\nMon-Fri., 9am-3pm)\r\n<br/><br/>\r\nps:  Please, do not reply to this message.\r\n<br/>'),
(9, 'No Picture Incomplete Profile', 'Please  Update your Profile', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br/><br/>\r\nDear [[to]]\r\n<br/><br/>\r\nThank you for registering with Match Made In Jannah!  A complete profile enhances your ability to find a partner who sees your details and feels the need to connect, so please take the time to fill your profile.  \r\n<br/><br/>\r\n Members who are seriously looking for a match, want to view not only the bio-data but want to have an idea about how their partner looks.  We recommend you upload a photo, but the final choice is always yours.  \r\n<br/><br/>\r\n<center>\r\n                                               Criteria to upload Photo(s)/Video\r\n</center>\r\n<br/>\r\n<table  border=\"1\">\r\n<tr>\r\n<td>\r\nPHOTO(S)\r\n</td>\r\n<td>\r\nAll Photos must be in color, close up, clear, bright, try not to have others in the picture, NO side profiles please, and all photos must be recent (1-3months).<br/>\r\n</td>\r\n</tr>\r\n\r\n<tr>\r\n<td>\r\nVIDEO \r\n</td>\r\n<td>\r\nAll Videos should be no longer than 30 sec. or less, please show both close-up and far views of yourself in a well-lit room.  When recording, say your: first Name ONLY,  Age, Profession, State, and a brief description of self as well as spouse preference. Please make sure you are the  ONLY person in the video.\r\n<br/>\r\n</td>\r\n</tr>\r\n\r\n<tr>\r\n<td>\r\nSCREENING\r\n</td>\r\n<td>\r\nOnce you upload a photo/video it will either be approved or rejected within 24   hours.   If you are not able to view your photo/video within 24hrs. it is probably because: a. We have a lot of registrants to screen b. You didn’t follow the photo criteria.  \r\n<br/><br/>\r\n If you need assistance or have any questions please contact us at matchmadeinjannah.com or call us at (248) 934-0075, and a representative will help you.\r\n<br/><br/>\r\nPlease join the rest to find your best!\r\n<br/><br/>\r\nSincerely,\r\n<br/><br/>\r\nBoard Members\r\n<br/>\r\nmatchmadeinjannah.com\r\ncustomers@matchmadeinjannah.com\r\n<br/>\r\n(248) 934-0075\r\n<br/>\r\nMon-Fri., 9am-3pm)\r\n<br/>\r\nps:  Please, do not reply to this message. \r\n<br/>'),
(10, 'New Message Email', 'Interest Shown', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\n    Congratulations [[to]]:\r\n    <br>\r\n    <br>\r\n    Someone has shown interest in you!\r\n    <br>\r\n    To see this member, please click matchmadeinjannah.com and log in.\r\n    <br><br>\r\n    Remember, always use good judgement when making a connection with someone new. <br><br> \r\nFor more information, go to our home page and click Services to view our Safety Tips and more.\r\n    <br>\r\n    <br>\r\n    Please, do not reply to this message.\r\n    <br>\r\n    <br>\r\n    Good Luck!\r\n    <br>\r\n    <br>\r\n    Sincerely,\r\n    <br> <br>\r\n    Board Members\r\n    <br>\r\n    Matchmadeinjannah.com\r\n    <br>\r\n    <br>\r\n    (248)934-0075<br>\r\n    (Mon-Fri., 9am-3pm)'),
(11, 'Delete Account', 'Account Deleted', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]],\r\n    <br><br>\r\nWe are sorry to see you go and hope that your stay with Match Made In Jannah was pleasant. Whatever the reason may be for you to leave us, we hope and pray that you are happy.\r\n<br><br>\r\nWe truly hope you enjoyed your search with us and hope that you found success through us and wish you all the happiness.    \r\n<br><br>\r\nIf our services have brought you success, please share your story with us. At the present time, we are offering all members who have found success to share their stories with a brief description.  Please write to success@matchmadeinjannah.com.  \r\n<br><br>\r\nIf you wish to display your Photo(s) on our home screen of your new-found, \"Match Made In Jannah\".  Please let us know which display you are interested in getting.\r\n<br><br>\r\n 1.  Home Screen display 1 Photo  -  1 week =  $  50.00\r\n 2.  Home Screen display 2 Photos - 2 weeks = $100.00\r\n<br><br>\r\nFinally, we truly value your opinion, so please feel free to leave us any feedback with comments, compliments, or suggestions at customers@matchmadeinjannah.com, so we can continue to improve our services.\r\n<br><br>\r\nMay Allah\'s’ blessings be always upon you!\r\n   <br><br>\r\nSincerely,\r\n    <br><br>\r\nMatch Made In Jannah\r\n    <br>\r\nBoard Members\r\n    <br>\r\ncustomers@matchmadeinjannah.com\r\n     <br>\r\n(248) 934-0075\r\n     <br>\r\nMon-Fri., 9am-3pm)\r\n     <br><br>\r\nps:  Please, do not reply to this message.\r\n</div>\r\n&lt;/body&gt;\r\n&lt;/html&gt;'),
(12, 'Downgrade to bronze due to Non Payment Email', 'Non Payment Downgrade', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]]:\r\n<br><br>\r\nWe are thrilled that you want to get onboard with Match Made In Jannah.  \r\nbr/><br>\r\nHowever, we have noticed that your Registration is not complete.  You were unable to charge your PayPal card account. This usually occurs when there is:\r\n<ul>\r\n<li>A billing error caused by your bank</li>\r\n<li>A change in your billing address</li>\r\n<li>Insufficient credit on your account</li>\r\n<li>Your credit card has expired</li>\r\n</ul>\r\n<br><br>\r\nPlease take the necessary actions to make your payment. We are looking forward to having you onboard with us.  \r\n<br><br>\r\nIf for any reason, you haven’t made your payment, within 3 days, we will then place you in our Bronze package, until you are able to make your payment.\r\n<br><br>\r\nIf you have any questions, please contact us.\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\n(248) 934-0075\r\n<br>\r\nMon-Fri., 9am-3pm)\r\n<br><br>\r\nps:  Please, do not reply to this message.\r\n<br>'),
(13, 'Activation Email(Platinum)', 'Registered & Activated Platinum Member', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]],\r\n<br><br>\r\nCongratulations, you are now a registered member with [[sitename]].\r\n<br>\r\nYour account is now activated, so please start your search.  We offer a database consisting of all age brackets, professions, residence, and citizenship.  We also offer both a Video & Picture upload which is totally optional.  However, many members find that the early establishment of physical attraction is important in their search for a spouse, you may find that your profile generates more interest with a photo.\r\n<br>\r\nLastly, please be committed to your search and believe in yourself. May Allah (Swat) help and guide you to find your soulmate.\r\n<br><br>\r\nWhen a man marries he indeed perfects half of his religion, then he should fear Allah for the remaining half.  (Bukhari)\r\n<br><br>\r\nPlease check your Invoice confirming the details of your transaction.\r\nbr/>\r\nGood luck, our blessings and prayers are with you!\r\n<br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\n(248) 934-0075\r\n<br>\r\nMon-Fri., 9am-3pm)\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n<br><br>\r\nps:  Please, do not reply to this message.\r\n<br>'),
(14, 'Activation Email(Bronze)', 'Registered & Activated Bronze Member', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]]:\r\n<br><br>\r\nThank you for registering with Match Made In Jannah, we are thrilled to have you aboard with us!  \r\n<br><br>\r\nYour account is now activated, so please make sure you have completed your profile to start your search.  We offer a database consisting of all age brackets, professions, residence, and citizenship.  We also offer both a Video & Picture upload which is totally optional.  However, many members find that the early establishment of physical attraction is important in their search for a spouse, you may find that your profile generates more interest with a photo.\r\n<br><br>\r\nLastly, please be committed to your search and believe in yourself. May Allah (Swat) help and guide you to find your soulmate.\r\n<br><br>\r\nThe Messenger of Allah (S) has said, \"There is no foundation that has been built in Islam more loved by Allah, (The Greatest and Noblest) than marriage.\"\r\n<br><br>\r\nWhen a man marries he indeed perfects half of his religion, then he should fear Allah for the remaining half.  (Bukhari)\r\n<br><br>\r\nPlease check your Invoice confirming the details of your transaction.\r\n<br><br>\r\nGood luck, our blessings and prayers are with you!\r\nbr/><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\n(248) 934-0075\r\n<br>\r\nMon-Fri, 9am-3pm)\r\n<br><br>\r\nps:  Please, do not reply to this message.\r\n<br>'),
(15, 'Photo Submission Email', 'Photo Submitted ', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]]:\r\n<br><br>\r\nWe have received your photo(s) and are in the process of screening.\r\n<br><br>\r\nThe screening of photo(s) will be approved or rejected within 24 hrs. If you are not able to view your photo within 24 hrs. it is probably because we either have a lot of registrants to screen or you did not follow the photo criteria.\r\n<br><br>\r\nAll photos must be in color, close up, clear, bright, NO side profiles, only you should be in the picture, \r\nand all photo(s) should be recent (1-3 months).   \r\nOnce we receive your photo(s) or video, you should receive a notice of criteria to follow within 1 week.\r\n<br><br>\r\nThe screening process is done only through our administrators and all photos are approved or rejected by them. Only they have access to all photos, videos, and profiles whom you have granted access to. Male administrators view male registrants & female administrators view female registrants. All photos, videos, and profiles remain completely private.\r\n<br><br>\r\nPlease note: you can continue to look at members, while your photo(s) is being screened.\r\n<br><br>\r\nGood luck!\r\n<br><br>\r\nJoin the rest to find the best with Match Made In Jannah!\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\n(248) 934-0075\r\n<br>\r\nMon-Fri, 9am-3pm)\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n<br><br>\r\nps:  Please, do not reply to this message.\r\n<br>'),
(16, 'Video Submission Email', 'Video Submitted', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br/><br/>\r\nDear [[to]]:\r\n<br/><br/>\r\nWe have received your video and are in the process of screening it.\r\n<br><br>\r\nThe screening of video will be approved or rejected within 24 hours. If you are not able to view your video within 24 hrs. it is probably because we either have a lot of registrants to screen or you didn’t follow the video criteria.\r\n<br/><br/>\r\nAll videos should be no longer than 30 sec. or less, please show both close-up and far views of yourself in a well-lit room.  When recording, say: first Name ONLY,  Age, Profession, State, and give a brief description of yourself as well as spouse preference. Your video should be in color, close up, clear, and bright, try not to have others in it, also, the video should be recent 1-3 months.  \r\nbr/><br/>\r\nThe screening process is done only through our administrators. All videos are approved or rejected by them. Only they have access to all photos, videos, and profiles, whom you have granted access to. Male administrators view male registrants & female administrators view female registrants. All photos, videos, and profiles remain completely private.\r\n<br/><br/>\r\nPlease make sure your language and dress are appropriate for your profile to be screened. While your video is being screened, you can search for members.\r\nbr/><br/>\r\nGood luck on your search, join the rest to find the best with Match made In Jannah!\r\n<br/><br/>\r\nSincerely,\r\n<br/><br/>\r\nBoard Members\r\n<br/>\r\nmatchmadeinjannah.com\r\n<br/>\r\n(248) 934-0075\r\n<br/>\r\ncustomers@matchmadeinjannah.com\r\n<br/>\r\nMon-Fri, 9am-3pm)\r\n<br/><br/>\r\nps:  Please, do not reply to this message.\r\n<br/>'),
(17, 'Photo Acceptance Email', 'Photo Approval', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]]:\r\n<br><br>\r\nCongratulations, your photo(s) screening has been approved!\r\n<br><br>\r\nYou will now be able to view your photo(s). Please log in to matchmadeinjannah.com, go to my profile, and select Photo(s) or Video Upload, then click on Photo and Video Privacy to choose who can view you.\r\n<br><br>\r\nIf you have any questions, please contact us.\r\n<br><br>\r\nGood luck on your search!\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n<br>\r\n(248) 934-0075\r\n<br>\r\nMon-Fri, 9am-3pm)\r\n<br><br>\r\nps:  Please, do not reply to this message.\r\n<br>'),
(18, 'Video Acceptance Email', 'Video Approved', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br/><br/>\r\nDear [[to]]:\r\n<br/><br/>\r\nCongratulations, your video screening has been approved!\r\n<br><br>\r\nYou will now be able to view your video. Please log in to matchmadeinjannah.com, go to my profile, and select Photo(s) or Video upload, then click on Photo & Video Privacy to choose who can view your video.\r\n<br/><br/>\r\nGood luck, on your search !\r\n<br/><br/>\r\nSincerely,\r\n<br/><br/>\r\nBoard Members\r\n<br/>\r\nmatchmadeinjannah.com\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n<br/>\r\n(248) 934-0075\r\n<br/>\r\nMon-Fri, 9am-3pm)\r\n<br/><br/>\r\nps:  Please, do not reply to this message.\r\n<br/>'),
(19, 'Photo Rejection Email', 'Photo Rejected', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]]:\r\n<br><br>\r\nSubject:  Please resubmit your photo(s) again.\r\n<br><br>\r\nThe screening process of your photos indicated that you did not meet our criteria.  Please see our guidelines below and upload pictures that meet our guidelines.\r\nbr/><br>\r\nAll Photos must be in color, close up, clear, bright, try not to have others in the picture, NO side profiles, and photos must be recent (1-3 months).\r\n<br><br>\r\nIf you have any questions, please contact us.\r\n<br><br>\r\nThank you.\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n<br>\r\n(248) 934-0075\r\n<br>\r\nMon-Fri, 9am-3pm)\r\n<br><br>\r\nps:  Please, do not reply to this message.\r\n<br>'),
(20, 'Video Rejection Email', 'Video Rejected', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br/><br/>\r\nDear [[to]]:\r\n<br/><br/>\r\nPlease upload a new video of yourself, the posted video did not meet with our criteria. \r\n<br><br>\r\nOur guidelines for uploading a video are: All Videos should be no longer than 30 sec. or less, please show both close-up and far views of yourself in a well-lit room.  When recording, say your first Name ONLY,  Age, Profession, State, and a brief description of yourself as well as spouse preferences. Please make sure you are the ONLY person in the video.\r\nbr/><br/>\r\nYour video should be in color, close up, clear, and bright, try not to have others in it, also, the video should be recent.\r\nbr/><br/>\r\nIf you have any questions, please contact us.\r\n<br/><br/>\r\nGood Luck!\r\n<br/><br/>\r\nSincerely,\r\n<br/><br/>\r\nBoard Members\r\n<br/>\r\nmatchmadeinjannah.com\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n<br/>\r\n(248) 934-0075\r\n<br/>\r\nMon-Fri, 9am-3pm)\r\n<br/><br/>\r\nps:  Please, do not reply to this message.\r\n<br/>'),
(21, 'PayPal Payment Failure Email', 'Stripe Payment Failure', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]]:\r\n<br><br>\r\nWe are thrilled that you want to get onboard with Match Made In Jannah.  \r\nbr/><br>\r\nHowever, we have noticed that your registration is not completed because of Stripe Payment Failure.  This usually occurs when there is:\r\n<br><br>\r\n<ul>\r\n<li>A billing error caused by your bank</li>\r\n<li>A change in your billing address</li>\r\n<li>Insufficient credit on your account</li>\r\n<li>Your credit card has expired</li>\r\n</ul>\r\n<br><br>\r\nPlease take the necessary actions to make your payment. We are looking forward to having you onboard with us.  \r\n<br><br>\r\nIf for any reason, you haven’t made your payment, within 3 days, we will then place you in our Bronze package.  Please upgrade to our Platinum Package when you are ready.\r\n<br><br>\r\nIf you have any questions, please contact us.\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\n(248) 934-0075\r\n<br>\r\nCustomers@matchmadeinjannah.com\r\n<br>\r\nMon-Fri., 9am-3pm)\r\n<br><br>\r\nps:  Please, do not reply to this message.\r\n<br>'),
(22, 'Advertisment Approval Email', 'Advertisement Approved', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[name]],\r\n<br><br>\r\nCongratulations, your advertisement for [[title]] has been approved!\r\n<br><br>\r\n<table>\r\n <tr>\r\n <th style=\"padding:10px 15px;font-size:12px;border-bottom:1px solid #000\">ID</th>\r\n <th  style=\"padding:10px 15px;font-size:12px;border-bottom:1px solid #000\">PACKAGE</th>\r\n <th  style=\"padding:10px 15px;font-size:12px;border-bottom:1px solid #000\">REGISTER</th>\r\n <th  style=\"padding:10px 15px;font-size:12px;border-bottom:1px solid #000\">BUSINESS NAME</th>\r\n <th  style=\"padding:10px 15px;font-size:12px;border-bottom:1px solid #000\">PAYMENT</th>\r\n <th  style=\"padding:10px 15px;font-size:12px;border-bottom:1px solid #000\">APPROVED</th>\r\n <th style=\"padding:10px 15px;font-size:12px;border-bottom:1px solid #000\">ADVERTISEMENT DISPLAYED</th> \r\n </tr>\r\n <tr>\r\n <td  style=\"padding:5px 15px;font-size:12px;text-align: center;\">[[to]]</td>\r\n <td style=\"padding:5px 15px;font-size:12px;text-align: center;\">[[DURATION]] months</td>\r\n <td style=\"padding:5px 15px;font-size:12px;text-align: center;\">[[REGISTER]]</td>\r\n <td style=\"padding:5px 15px;font-size:12px;text-align: center;\">[[title]]</td>\r\n <td style=\"padding:5px 15px;font-size:12px;text-align: center;\">$[[AMOUNT]]</td>\r\n <td style=\"padding:5px 15px;font-size:12px;text-align: center;\">[[APPROVED]]</td>\r\n <td style=\"padding:5px 15px;font-size:12px;text-align: center;\">[[DISPLAY]]</td>\r\n </tr>\r\n</table>\r\n<br><br>\r\nPlease click <a href=\'[[base_url]]home/adsdetails/[[unique_id]]\'><u><b>HERE.</b></u></a> to view your advertisement details and save this email to make future corrections.  If you need to edit your advertisement, you can either do it yourself or contact us.\r\n<br><br>\r\nIt is a pleasure to serve you as our customer, and we look forward to continually doing business with you.\r\n<br><br>\r\nIf you have any further questions, please contact us.\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n<br>\r\n(248) 934-0075\r\n<br>\r\nMon-Fri, 9am-3pm)\r\n<br><br>\r\nPlease, do not reply to this message.\r\n<br>'),
(23, 'Ads Rejection Email', 'Advertisement Rejection', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear Mr. [[name]],\r\n<br><br>\r\nThis is to inform you that your business advertisement has been rejected due to the content or photo posted. Please read our Terms and Conditions explanations in details. \r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nMatch Made In Jannah Team\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n<br>\r\n(248) 934-0075\r\n<br>\r\nMon-Fri, 9am-3pm)\r\n<br><br>'),
(24, 'Ads URL SEND', 'Advertisement Submitted', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[name]],\r\n<br><br>\r\nWe have received your business advertisement for [[title]] and look forward to advertising for you! \r\n<br><br>\r\nYour advertisement will be reviewed and you will receive a notice within 24hrs.   Halal advertisements will always be accepted and if your advertisement is rejected, you will receive a full refund within a week. \r\n<br><br>\r\nIt is a pleasure to serve you as our valued customer, we look forward to continually doing business with you.<br><br>\r\nThank you again for choosing Match Made In Jannah.\r\n<br><br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n<br>\r\nMon-Fri, 9am-3pm)\r\n<br><br>\r\nPlease, do not reply to this message.\r\n<br>'),
(25, 'Cover Pic payment Complete', 'Promote Your Photo', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nAssalam  [[to]]:\r\n<br><br>\r\nThank your for choosing Promote Your Picture, your photo will be displayed on the home screen as soon as the screening process is done.\r\n<br><br>\r\nPlease follow the criteria for uploading photos so it is not rejected.  To see photo criteria, go to www.matchmadeinjannah.com, click on services, select frequently asked questions and see question #12.  If your photo is rejected, please upload another photo.  \r\n<br><br>\r\nGood luck !\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\n(248) 934-0075\r\n<br>\r\nMon-Fri, 9am-3pm)\r\n<br>\r\nsuccess@matchmadeinjannah.com\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n<br><br>\r\nps: Please, do not reply to this message.\r\n<br>'),
(26, 'Cover Pic approve', 'Cover Photo Approved', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]]\r\n<br><br>\r\nCongratulations, your Cover Photo has been approved!\r\n<br><br>\r\nPlease review your Cover Photo invoice below.\r\n<br><br>\r\n<table xss=\'removed\' xss=removed>\r\n <tr>\r\n <th>ID</th>\r\n <th>REGISTERED</th>\r\n <th>PACKAGE</th>\r\n <th>PAYMENT</th>\r\n <th>COVER PHOTO DISPLAYED</th> \r\n </tr>\r\n <tr>\r\n <td>[[DISPLAY]]</td>\r\n <td>[[PAID]]</td>\r\n <td>[[WEEK]] Week</td>\r\n <td>$[[AMOUNT]]</td>\r\n <td>[[PHOTO SHOWING]]</td>\r\n </tr>\r\n</table>\r\n<br><br>\r\nIf you have any questions, please contact us.\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\n(248) 934-0075\r\n<br>\r\nMon-Fri, 9am-3pm)\r\n<br><br>\r\nps: Please, do not reply to this message.\r\n<br>'),
(27, 'Cover Pic Send', 'Cover Photo Submitted', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]],\r\n<br><br>\r\nWe have received your Cover Photo and are in the process of screening.\r\n<br><br>\r\nThe screening of your Cover Photo will be approved or rejected within 24 hrs. If you are not able to view your photo\r\nwithin 24 hrs. it is probably because we either have a lot of registrants to screen or you did not follow the Cover\r\nPhoto criteria. All photos must be in color, close up, clear, bright, and all photo(s) should be recent (1-3months).\r\n<br><br>\r\nThe screening process is done only through our administrators whom you have granted access, and only they can\r\nview your Cover Photo. Male administrators view male registrants & female administrators view female registrants.\r\n<br><br>\r\nIf you have any questions, please contact us.\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n<br>\r\n(248) 934-0075\r\n<br>\r\nMon-Fri, 9am-3pm)\r\n<br><br>\r\nps: Please, do not reply to this message.\r\n<br>'),
(28, 'Advertisement Expired', 'Advertisement Renewal', '<a><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear {Member’s first name},\r\n<br><br>\r\nWe have noticed that your advertisement for {business_name} is close to the end of its term.  To continue your advertisement, please click RENEW and select the desired package.\r\n<br><br>\r\n<table cellspacing=\"10\">\r\n<tr>\r\n   <td><b>ID #</b></td>\r\n   <td><b>BUSINESS NAME</b></td>\r\n   <td><b>ADVERTISEMENT DISPLAYED </b></td>\r\n   <td><b>PACKAGE</b></td>\r\n   <td><b>PAYMENT</b></td>\r\n</tr>\r\n<tr>\r\n<td>{invoice_no}</td>\r\n<td>{business_name}</td>\r\n<td>{date}</td>\r\n<td>{package} Months</td>\r\n<td>${payment}</td>\r\n<td><a href=\'{link}\' class=\"btn btn-primary btn-sm\">RENEW</a></td>\r\n</tr>\r\n</table>\r\nIf you do not wish to renew, please ignore this email and your advertisement will NOT be displayed after {end_date}.\r\n<br><br>\r\nIt is a pleasure to serve you as our customer and we look forward to doing business with you again.\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n<br>\r\nMon-Fri, 9am-3pm\r\n<br><br>\r\nPlease, do not reply to this message.\r\n<br>'),
(29, 'blank email letter', 'Blank Email Letter', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]]\r\n<br><br>\r\nWrite your necessary text here...\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\n(248) 934-0075\r\n<br>\r\nMon-Fri, 9am-3pm)\r\n<br><br>\r\nPlease, do not reply to this message.\r\n<br>'),
(30, 'TEst', 'Advertisement Invoice', '<a><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear {name},\r\n<br><br>\r\nThis is to acknowledge our receipt of your invoice number {invoice_number}.\r\n<br><br>\r\nOur records indicates that a payment was made for the advertisement  of {bus_name}.<br><br>\r\n<table cellspacing=\"20\">\r\n    <tr>\r\n<td><b><u>INVOICE#</u></b></td>\r\n<td><b><u>DATE</u></b></td>\r\n<td><b><u>PACKAGE</u></b></td>\r\n<td><b><u>PAYMENT</u></b></td>\r\n<td><b><u>PHONE</u></b></td>\r\n<td><b><u>ADDRESS</u></b></td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\">{invoice_number}</td>\r\n<td align=\"left\">{date}</td>\r\n<td align=\"left\">{package} Months</td>\r\n<td align=\"left\">{payment_type}</td>\r\n<td align=\"left\">{phone}</td>\r\n<td align=\"left\" xss=removed>{address}</td>\r\n</tr>\r\n</table>\r\n <br>\r\nIt is a pleasure to serve you as our customer and we look forward to continually doing business with you.\r\n<br><br>\r\nThank you again for choosing Match Made In Jannah.\r\n<br><br>\r\nBest of  luck!\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n<br>\r\nMon-Fri, 9am-3pm\r\n<br>\r\nPlease, do no reply to this message.\r\n<br>\r\n'),
(31, 'Check', 'Cover Photo Rejection', '<a href=\'[[base_url]]\'><img src=\'[[base_url]]uploads/header_logo/header_logo_1558265578.png\'></a>\r\n<br><br>\r\nDear [[to]], \r\n<br><br>\r\nYour Cover Photo has been rejected, please upload another photo.\r\n<br><br>\r\nAll Photos must be in color, close up, clear, bright, NO side profiles, & photo must be recent (1-3 months). Your\r\nphoto must be decent and appropriate. Match Made In Jannah, can and will reject any photos that go against our\r\ncriteria.\r\n<br><br>\r\nIf you have any questions, please contact us.\r\n<br><br>\r\nSincerely,\r\n<br><br>\r\nBoard Members\r\n<br>\r\nmatchmadeinjannah.com\r\n<br>\r\ncustomers@matchmadeinjannah.com\r\n<br>\r\n(248) 934-0075\r\n<br>\r\nMon-Fri, 9am-3pm)\r\n<br><br>\r\nps: Please, do not reply to this message.\r\n<br>');
