(9, 'terms_conditions', '<p></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>Welcome to <b>Match Made In Jannah</b>, this is a Muslim matrimonial service for single Muslim\r\nadults, who are over the age of 18 years and are looking to meet others online.</p>\r\n\r\n<p>By\r\naccessing matchmadeinjannah.com, you agree\r\nto be bound by these Terms & Conditions, when you register as a member of matchmadeinjannah.com. If you wish to become a member and make\r\nuse of Matchmadeinjannah.com service(s), please read these Terms & Conditions.\r\nThe term \"Website\" is deemed to refer to using the Service by\r\nmeans of a computer, a mobile device, or a mobile application.</p>\r\n\r\n<p>Also,\r\nread the <a target=\"_blank\" rel=\"nofollow\" href=\"http://www.match.com/registration/privacystatement.aspx\">Match Made In Jannah Privacy Policy</a>, which is incorporated by reference\r\ninto this Agreement and available on the Website. If you do not accept and\r\nagree to be bound by all or any of the terms of this Agreement, including the <a target=\"_blank\" rel=\"nofollow\" href=\"http://www.matchmadeinjannah.com\">www.matchmadeinjannah.com</a> Privacy Policy, please do not use the Website or the\r\nService. If you have any questions regarding this Agreement, please contact us.</p><p><b>1.  </b><u><b>Acceptance of Terms of Use Agreement</b></u></p>a. This Agreement is an electronic\r\ncontract that establishes the legally binding terms you must accept to use this\r\nWebsite and to become a \"Member.\" For purposes of this Agreement, the\r\nterm \"<b><u>Member</u></b>\" means a person who gives information to\r\nthe Company on the Website or uses the Service as a free member or a\r\nsubscriber. This Agreement includes the Company’s (i) Privacy Policy, (ii)\r\nour<a target=\"_blank\" rel=\"nofollow\" href=\"http://www.match.com/help/safetytips.aspx\"> Safety Tip</a>s published on the Website  (iii) and term­­s disclosed and agreed to by\r\nyou if you become a subscriber or if you purchase or accept additional services we offer on the Website.<p>b. By using the Service/Website, you\r\naccept this Agreement and agree to the terms, conditions, and notices contained\r\nherein and consent to have this Agreement and all notices provided to you in an\r\nelectronic form. Please print a copy of this Agreement for your records. This agreement may be modified by the Company from time to time, such modifications are\r\nto be effective as soon as possible, upon posting by the Company on the\r\nWebsite.</p>\r\n\r\n<p>c. By using the Service, you consent to\r\nreceive this Agreement in electronic form by using the Service. To withdraw\r\nthis consent, you must cease using the Service and terminate your account.</p><p><b>2.  <u>Eligibility</u></b></p><p><b>You must be at least 18 years of age to access and use the Service.  When you register and become a Member, you\r\nswear that you have never been convicted of a felony.   You must be single and/or separated from\r\nyour spouse.  By accessing and using the\r\nWebsite, you represent and warrant that you have the right, authority, and\r\ncapacity to enter this Agreement and to abide by all of the terms and\r\nconditions of this Agreement. Any use of the Service is void where prohibited. If\r\nyou use the Service from outside of the United States, you are responsible for\r\ncomplying with the laws and regulations of the territory from which you access\r\nor use the Website or Service.</b></p><p><b>3. </b> <b><u>Membership and Subscription</u></b></p>\r\n\r\n<p>You\r\nwill register as a Member with a payment.  A Member profile &#40;both subscribers and\r\nnon-subscribers&#41; may remain posted on the Website even if that Member is not\r\nactively using the Service. You acknowledge that although a Member’s profile\r\nmay be viewed, you may not (even as a subscriber) be able to use the Service to\r\ncommunicate with that Member if he or she is not then actively using the\r\nService.</p><p><b>4.</b>  <b><u>Term\r\n     and Termination</u></b></p>\r\n\r\n<p>a. This Agreement will remain in full\r\nforce and effect while you use the Service and/or are a Member.</p>\r\n\r\n<p>b.  You may change or cancel your\r\nmembership at any time, for any reason, by following the instructions on the\r\n\"change/cancel membership\" or on your \"Account Settings\"\r\npage. You may also send us an email notice of cancellation to  customers@matchmadeinja nnah.com.  If you cancel your membership via the Website, we may ask\r\nyou to provide a reason for your cancellation. If you cancel your membership,\r\nyour profile will be removed, and other Members will not be able to view your\r\nprofile. You will be able to use your current registration information to\r\n\"unhide\" your profile and reactivate your membership for one year. A Member\r\ncan hide his or her profile or cancel his or her membership and remove their\r\nprofile at any time.</p>\r\n\r\n<p>c. The Company may terminate or suspend\r\nyour membership at any time without notice if the Company believes that you\r\nhave breached this Agreement. Upon such termination or suspension, you will not\r\nbe entitled to any refund and other fees you owe will immediately be due. The company is not required to disclose and may be prohibited by law from\r\ndisclosing, the reason for the termination or suspension of your account.</p>\r\n\r\n<p><b>5. </b> <b><u>Non-commercial Use by Members</u></b></p>\r\n\r\n<p>The website is for all member’s personal use only.  Any company, organization, and/or businesses may\r\nnot use this Website for any purpose what so ever. Members are not allowed to\r\nuse this Service about any commercial events, or even to solicit others to\r\nattend social functions, and/or networking for commercial purposes. Users of this Website may not use any\r\ninformation obtained from the Service to contact, advertise to, solicit, or\r\nsell to any other user without his or her prior explicit consent.  Our Company may investigate and take any\r\navailable legal action in response to illegal and/or unauthorized uses of this\r\nWebsite, including collecting usernames and/or email addresses of members by\r\nelectronic or other means for sending unsolicited email and unauthorized\r\nframing of or linking to the Website.</p><p><b>6. </b> <b><u>Account\r\n     Security</u></b></p>\r\n\r\n<p>You\r\nalone will be responsible for all activities that occur under your username and\r\npassword. You are responsible for keeping the confidentiality of your username\r\nand password you designated during the registration process. You agree to immediately notify the Company\r\nof any disclosure or unauthorized use of your username or password or any other\r\nbreach of security.  You agree that you will\r\nlog out from your account at the end of each session.</p><p><b>7. </b> <b><u>Your Interactions with Other Members</u></b></p>\r\n\r\n<p>a. <b></b>YOU\r\nUNDERSTAND THAT THE COMPANY CURRENTLY <u>DOES NOT</u> CONDUCT CRIMINAL\r\nBACKGROUND CHECKS OR SCREENINGS ON ITS MEMBERS OR ATTEMPT TO VERIFY THE\r\nSTATEMENTS OF ITS MEMBERS. YOU ALONE WILL BE HELD RESPONSIBLE FOR YOUR RELATIONS\r\nWITH OTHER MEMBERS. THE COMPANY MAKES NO REPRESENTATIONS OR WARRANTIES AS TO\r\nTHE CONDUCT OF MEMBERS AND/OR THEIR COMPATIBILITY WITH ANY CURRENT OR FUTURE\r\nMEMBERS. THE COMPANY RESERVES THE RIGHT TO CONDUCT ANY CRIMINAL BACKGROUND\r\nCHECK OR OTHER SCREENINGS (SUCH AS SEX OFFENDER REGISTER SEARCHES), AT ANY TIME\r\nAND USING AVAILABLE PUBLIC RECORDS.<b></b></p>\r\n\r\n<p>b. <b></b>The company is not responsible for the conduct of any Member. As noted in and\r\nwithout limiting Sections 16 and 18 below, in no event shall the Company, its\r\naffiliates or its partners be liable (directly or indirectly) for any losses or\r\ndamages whatsoever, general, special, compensatory, consequential, and/or\r\nincidental, arising out of or relating to the conduct of you or anyone else in\r\nconnection with the use of the Website or Service including, without\r\nlimitation, death, bodily injury, emotional distress, and/or any other damages\r\nresulting from communications or meetings with other Members or persons you\r\nmeet through the Service.<b> </b>You\r\nagree to take all necessary precautions in all interactions with other Members,\r\nparticularly if you decide to communicate off the Website or meet in person, or\r\nif you decide to send money to another Member. <b>In addition, you agree\r\nto review and follow the Company\'s </b><b><a target=\"_blank\" rel=\"nofollow\" href=\"http://www.match.com/help/safetytips.aspx\">Safety Tips</a> </b><b>located on the Website, prior to using the Service.</b> You understand that the Company makes no guarantees,\r\neither express or implied, regarding your ultimate compatibility with\r\nindividuals you meet through the Service. You should not provide your financial\r\ninformation (for example, your credit card or bank account information), or\r\nwire or otherwise send money, to other Members.</p>\r\n\r\n<p><b>8. </b><b><u>Proprietary Rights</u></b></p>\r\n\r\n<p>The company owns and holds all proprietary rights in the Website in all content,\r\ntrademarks, and other intellectual property rights related thereto. The Website\r\ncontains the copyrighted material, trademarks, and other proprietary information\r\nof the Company. You agree not to alter any proprietary notices appearing on any\r\ncontent as well as transmit or reproduce in any way to any information accessible\r\non the Website or the Service, without first obtaining the written consent of the\r\nCompany or its’ owner of such proprietary rights. </p>\r\n\r\n<p><b>9. </b><b> <u>Content Posted by You on the Website</u></b></p>\r\n\r\n<p>a. You are solely responsible for all information/content\r\nthat you post/upload, weather videos (including streaming videos), emails,\r\nphotographs, recordings, voice notes, profiles texts, hereinafter, on the\r\nService, whether publicly/privately posted or transmitted. You certify that all\r\ninformation submitted upon registration is truthful and that you update all as\r\nsoon as possible. You may not post on the Website/Company or to a Member any sexually\r\noriented, abusive, offensive, profane, obscene, inaccurate, racially offensive,\r\nor any illegal material, or material that violates another person’s rights\r\n(including publicity, privacy, and intellectual property rights) on or of the\r\nwebsite.  </p>\r\n\r\n<p>b. You understand and agree that the company may monitor or review any Content you post on the Website if they so\r\nchoose. The Company may delete any or all content, that violates or harms this\r\nAgreement or may harm the reputation of the Website, weather it is a Business Advertisement, or a Cover Screen post. The Company\r\ncan restrict the number of emails sent to other Members within a 24-hour\r\nperiod.  You understand and agree that Match Made In Jannah has full right to reject any advertisements, or cover photos, and/or personal photos, without any explanations.</p>\r\n\r\n<p>c. By posting Content on the Website,\r\nyou automatically grant to the Company and its associates, a worldwide right\r\nand license to: play, use, record, copy, reproduce, display, store, perform, alter\r\nand distribute the Content(s), plagiarize Content or include the Content into\r\nother works.  You represent and warrant\r\nthat any posting and use of your Content by the Company will not infringe or\r\nviolate the rights of any third party.</p>\r\n\r\n<p>d. The Contents below are prohibited on\r\nthe Website:</p>\r\n\r\n<p>·        \r\nAsk for money, or has the intention of the deceit of other users of the Website or Service.</p>\r\n\r\n<p>·        \r\nTo hold video, audio photographs, or\r\nimages of another person without his/her permission; promotes an unauthorized\r\ncopy of another person’s copyrighted work, such as providing pirated computer programs or links to them, providing information to circumvent\r\nmanufacture-installed copy-protect devices, or providing pirated images, audio\r\nor video, or links to pirated images, audio or video files;</p>\r\n\r\n<p>·        \r\nProvides instructional information\r\nabout illegal activities such as making or buying illegal weapons or drugs,\r\nviolating someone’s privacy, or providing, disseminating or creating computer\r\nviruses;</p>\r\n\r\n<p>·        \r\nContains viruses, Trojan horses,\r\ntime bombs, cancelbots, worms or other harmful, or disruptive codes,  components\r\nor devices;</p>\r\n\r\n<p>·        \r\nDisrupts the normal flow of\r\ndialogue, causes a screen to \"scroll\" faster than other users are\r\nable to type, or otherwise negatively affects other users’ ability to engage in\r\nreal-time exchanges;</p>\r\n\r\n<p>·        \r\nImpersonates, or misrepresents\r\naffiliation, connection or association with, any person or entity; promotes\r\ninformation that is false or misleading, promotes illegal activities or conduct\r\nthat is defamatory; provides material that exploits people in a sexual, violent or another illegal manner;</p>\r\n\r\n<p>·        \r\nPromotes discrimination, hatred or\r\nphysical harm of any kind against any group or individual; promotes harassment\r\nor intimidation of another person.</p>\r\n\r\n<p>·        \r\nProvides information or data you do\r\nnot have a right to make available under law or under contractual or fiduciary\r\nrelationships (such as inside information, proprietary and confidential\r\ninformation);</p>\r\n\r\n<p>·        \r\nPublicizes or promotes commercial\r\nactivities and/or sales without our prior written consent.</p>\r\n\r\n<p>·        \r\nSolicits passwords or personal\r\nidentifying information for commercial or unlawful purposes from other users or\r\ndisseminates another person’s personal information without his or her\r\npermission.</p>\r\n\r\n<p>The Company reserves the right, in its discretion, to\r\ninvestigate and take appropriate legal action against anyone who violates this provision,\r\nincluding removing his/her communication from the Website and/or terminating or\r\nsuspending the membership of violators.</p>\r\n\r\n<p>e. Your use of the Website, and everything\r\nyou post in it, must comply with all rules and regulations. You agree that the company can access, disclose, and preserve your account information and its contents\r\nif required to do so by law such as to (1) enforce this Agreement; (2) respond\r\nto your requests for customer service or allow you to use the Website in the\r\nfuture; or (3) protect the rights, property or personal safety of the Company\r\nor any other person; (4) respond to claims that any Content violates the rights\r\nof third parties; (5) comply with the legal process.</p>\r\n\r\n<p>f. You may not post on your Member\r\nProfile, any telephone numbers, street addresses, last names, URLs or email\r\naddresses that may be viewed by other Members. You know that all the Content\r\nyou place on the Website may be viewed by any person visiting the Website or\r\nparticipating in the Service.</p><p><b>10.</b>  <b><u>Banned Activities</u></b></p>\r\n\r\n<p>Company\r\nreserves the right to investigate and/or terminate your membership, if the Service\r\nregards as inappropriate or unlawful, as well as actions or communications that\r\noccur off the Website. <b><u></u></b></p>\r\n\r\n<p>Below, please see a list of actions that you may <b><u>NOT</u></b> participate in:</p>\r\n\r\n<p>·        \r\nThe Collect usernames and/or email\r\naddresses of members by electronic or any other means </p>\r\n\r\n<p>·        \r\nEmail or otherwise transmit any\r\nmaterial that contains software viruses or any other computer code, files or\r\nprograms designed to interrupt, destroy or limit the functionality of any\r\ncomputer software or hardware or telecommunications equipment.</p>\r\n\r\n<p>·        \r\nExpress or imply that any statements\r\nyou make are endorsed by the Company without our specific prior written\r\nconsent.</p>\r\n\r\n<p>·        \r\nForge headers or otherwise\r\nmanipulate identifiers in order to disguise the origin of any information transmitted to or through the Website (either directly or indirectly through\r\nuse of third party software).</p>\r\n\r\n<p>·        \r\nFrame any part of the Website,\r\nwithout the Company\'s written authorization.</p>\r\n\r\n<p>·        \r\nImpersonate anyone.</p>\r\n\r\n<p>·        \r\nInterfere with or disrupt the\r\nService, website, servers, networks connected to the Service and or the Website.</p>\r\n\r\n<p>·        \r\nModify, translate, adapt,\r\nsublicense, sell, decompile, reverse engineer, decipher or disassemble any a portion of the Service or the Website or any software used on or for the\r\nWebsite, or cause others to do so.</p>\r\n\r\n<p>·        \r\npost, use, transmit or distribute,\r\ndirectly or indirectly, (e.g. screen scrape) in any manner or media any content\r\nor information obtained from the Website or the Service other than solely your\r\nuse of the service about this Agreement.</p>\r\n\r\n<p>·        \r\nsolicit money from any Members, even\r\nto ask or use Members to conceal their identity, source, and/or destination of\r\nany illegally gained money or products.</p>\r\n\r\n<p>·        \r\nStalk/harass any person.</p>\r\n\r\n<p>·        \r\nuse any robot, spider, site\r\nsearch/retrieval application, or other manual or automatic device or process  to\r\nretrieve, index, \"data mine\", or in any way reproduce or circumvent\r\nthe navigational structure or presentation of the Website, Service or its\r\ncontents.</p>\r\n\r\n<p>·        \r\nuse meta tags or code or other\r\ndevices containing any reference to the Company, the Website, or the Service\r\n(or any trademark, trade name, service mark, logo or slogan of the Company) to\r\ndirect any person to any other website for any purpose.</p><p><b>11.</b>  <b><u>Customer\r\n     Service</u></b></p>\r\n\r\n<p>· The Company aids and guidance\r\nthrough its customer care representatives. When communicating with our customer\r\ncare representatives (whether over the telephone or via email or letter), you\r\nagree to  not otherwise behave inappropriately. Telephone calls between you and\r\nour customer care representatives may be recorded for quality assurance\r\npurposes. If we feel that your behavior towards  any of our customer care\r\nrepresentatives or other employees is at any time threatening or offensive, we\r\nreserve the right to immediately terminate your membership and you will not be\r\nentitled to any refund of unused subscription fees.</p><p><b>12.</b>  <b><u>Charges on Your Billing Account</u></b></p>\r\n\r\n<p> . The Company bills you through an\r\nonline Package you buy for use of the Service.  You  agree to pay the Company all charges at the price you agreed to\r\nfor any use of the Service by you or any other person(s) including your agents using your Package Account as well as making payments  using the selected\r\nPayment Method, and you authorize the Company to charge your chosen payment provider (your \"<b><u>Payment Method</u></b>\") for the Service.  The Company may correct any billing errors or mistakes that it makes even if it has already requested or received payment.\r\nThis Section includes any agreements you made with the Company on the Website\r\nwhen becoming a Member or subscribing to the Service. The terms of your payment\r\nwill be based on your Payment Method and may be determined by agreements\r\nbetween you and the financial institution, credit card issuer, or another provider of your chosen Payment Method. If you initiate a chargeback or otherwise\r\nreverse a payment made with your Payment Method, the Company may in its\r\ndiscretion terminate your account  immediately. If the Company successfully\r\ndisputes the reversal, and the reversed funds are returned, you are not\r\nentitled to a refund or to have your account or subscription reinstated.</p>\r\n\r\n<p>a. Your membership will continue\r\nindefinitely until canceled by you. After your initial membership commitment\r\nperiod, and again after any subsequent membership period, your membership will automatically continue for an additional equivalent period, at the price\r\nyou agreed to when  subscribing. If the user cancels before the 30 day period, the user is required to pay the full amount. You agree that your account will be subject to\r\nthis automatic renewal feature. If you do not wish your account to renew\r\nautomatically, or if you want to change or terminate your subscription, please\r\nlog in and go to <u>\"Account Settings\"</u> on the Website and follow\r\nthe directions contained therein. If you  cancel  your subscription, you may use\r\nyour subscription until the end of your then-current membership term; your membership will not be renewed after your then-current term expires. However,\r\nyou won’t be eligible for a prorated refund of any portion of the subscription\r\nfee paid for the then-current membership period. By subscribing, you\r\nauthorize the Company to charge your Payment Method now and again at the\r\nbeginning of any subsequent subscription period. You also authorize the Company\r\nto charge you for any sales or similar taxes that may be imposed on your subscription payments. Upon the renewal of your subscription, if the Company does not\r\nreceive payment from your Payment Method Provider, you agree to pay all amounts\r\ndue on your Billing Account upon demand and/or you agree that the Company may\r\neither terminate or suspend your subscription and continue to attempt to charge\r\nyour Payment Method provider until payment is received (upon receipt of\r\npayment, your account will be activated and for purposes of automatic renewal,\r\nyour new subscription commitment period will begin as of the day payment was\r\nreceived).</p>\r\n\r\n<p>b. You must provide current, complete\r\nand accurate information for your Billing Account. You must promptly update all\r\ndata to keep your Billing Account up-to-date, complete and accurate, whether\r\nit’s a change in billing address, card number, or expiration date), and you\r\nmust promptly alert the Company if your Payment Method is annulled (including\r\nif your card is lost or stolen), or if you   become  aware of a potential breach\r\nof security (such as an unauthorized disclosure or use of your name/password).\r\nChanges to such type of information can be made at \"Account Settings\"\r\non the Website. On the other hand, if you don’t provide the Company any of the foregoing information, you agree that you are responsible for fees accrued\r\nunder your Billing Account.  On the other\r\nhand, you also permit us to obtain updated or replacement expiration dates and\r\ncard numbers your credit or debit card as provided by your credit or debit card\r\nissuer. You also permit us to update your Payment Method to include any credit\r\nor debit card or other payment method provided by you for service throughout\r\nyour use of the Website or Service when automatically renewing your account.</p><p><b>13.</b>  <b><u>Modifications\r\n     to Service</u></b></p>\r\n\r\n<p>The\r\nCompany reserves the right at any time to alter or cease, momentarily or\r\npermanently, the Website or the Service (or any part thereof) with or without\r\nnotice. You agree that the Company shall not be liable to you or to any third\r\nparty for any modification, disruption, or discontinuance of the Service. To\r\nprotect the integrity of the Website or the Service, the Company reserves the\r\nright at any time in its sole discretion to block users from certain IP\r\naddresses from accessing the Website or Service.</p><p><b>14.</b>  <b><u>Copyright\r\n     Policy; Notice & Procedure for Making Claims of Copyright Infringement</u></b></p>\r\n\r\n<p>You\r\nmay not post, dispense, or replicate in any way any copyrighted material, logos,\r\nor other proprietary informatio