f you decide to send money to another Member. <b>In addition, you agree\r\nto review and follow the Company\'s </b><a target=\"_blank\" rel=\"nofollow\" href=\"http://www.match.com/help/safetytips.aspx\"><b>Dating Safety Tips</b></a><b>, located on the Website, prior to using the Service.</b> You understand that the Company makes no guarantees,\r\neither express or implied, regarding your ultimate compatibility with\r\nindividuals you meet through the Service. You should not provide your financial\r\ninformation (for example, your credit card or bank account information), or\r\nwire or otherwise send money, to other Members.</p>\r\n\r\n<p><b>30. </b> <b><u>Proprietary Rights</u></b></p>\r\n\r\n<p>The company owns and holds all proprietary rights in the Website in all content,\r\ntrademarks, and other intellectual property rights related thereto. The Website\r\ncontains the copyrighted material, trademarks, and other proprietary information\r\nof the Company. You agree not to alter any proprietary notices appearing on any\r\ncontent as well as transmit or reproduce in any way to any information accessible\r\non the Website or the Service, without first obtaining the written consent of the\r\nCompany or its’ owner of such proprietary rights. </p>\r\n\r\n<p><b>31.</b>  <b><u>Content Posted by You on the Website</u></b></p>\r\n\r\n<p>a. You are solely responsible for all information/content\r\nthat you post/upload, weather videos (including streaming videos), emails,\r\nphotographs, recordings, voice notes, profiles texts, hereinafter, on the\r\nService, whether publicly/privately posted or transmitted. You certify that all\r\ninformation submitted upon registration is truthful and that you update all as\r\nsoon as possible. You may not post on the Website/Company or to a Member any sexually\r\noriented, abusive, offensive, profane, obscene, inaccurate, racially offensive,\r\nor any illegal material, or material that violates another person’s rights\r\n(including publicity, privacy, and intellectual property rights) on or of the\r\nwebsite.</p>\r\n\r\n<p>b. You understand and agree that the company may monitor or review any Content you post on the Website if they so\r\nchoose. The Company may delete any or all content, that violates or harms this\r\nAgreement or may harm the reputation of the Website or the Company. The Company\r\ncan restrict the number of emails sent to other Members within a 24-hour\r\nperiod.</p>\r\n\r\n<p>c. By posting Content on the Website,\r\nyou automatically grant to the Company and its associates, a worldwide right\r\nand license to: play, use, record, copy, reproduce, display, store, perform, alter\r\nand distribute the Content(s), plagiarize Content or include the Content into\r\nother works.  You represent and warrant\r\nthat any posting and use of your Content by the Company will not infringe or\r\nviolate the rights of any third party. </p>\r\n\r\n<p>d. The Contents below are prohibited on\r\nthe Website:</p>\r\n\r\n<p>·        \r\nAsk for money, or has the intention of the deceit of other users of the Website or Service;</p>\r\n\r\n<p>·        \r\nTo hold video, audio photographs, or\r\nimages of another person without his/her permission; promotes an unauthorized\r\ncopy of   another person’s copyrighted work, such as providing pirated computer\r\nprograms or links to them, providing information to circumvent\r\nmanufacture-installed copy-protect devices, or providing pirated images, audio\r\nor video, or links to pirated images,  audio or video files; </p>\r\n\r\n<p>·        \r\nProvides instructional information\r\nabout illegal activities such as making or buying illegal weapons or drugs,\r\nviolating someone’s  privacy, or providing, disseminating or creating computer\r\nviruses;</p>\r\n\r\n<p>·        \r\nContains viruses, Trojan horses,\r\ntime bombs, cancelbots, worms or other harmful, or disruptive codes, components\r\nor devices;</p>\r\n\r\n<p>·        \r\nDisrupts the normal flow of\r\nd