ed to any refund of unused subscription fees.</p><p><b>34.</b>  <b><u>Subscriptions; Charges on Your Billing Account</u></b></p>\r\n\r\n<p>The Company bills you through an\r\nonline account (your \"<b><u>Billing Account</u></b>\") for use of the\r\nService. You agree to pay the Company  all charges at the prices you agreed to\r\nfor any use of the Service by you or other persons (including your agents)\r\nusing your Billing  Account as well as making payments using the selected\r\nPayment Method, and you authorize the Company to charge your chosen payment\r\nprovider (your \"<b><u>Payment Method</u></b>\") for the Service.  The Company may correct any billing errors or\r\nmistakes that it makes even if it has already requested or received payment.\r\nThis Section includes any agreements you made with the Company  on the Website\r\nwhen becoming a Member or subscribing to the Service. The terms of your payment\r\nwill be based on your  Payment Method and may be determined by agreements\r\nbetween you and the financial institution, credit card issuer, or other  providers of your chosen Payment Method. If you initiate a chargeback or otherwise\r\nreverse a payment made with your Payment  Method, the Company may in its\r\ndiscretion terminate your account immediately. If the Company successfully\r\ndisputes the reversal, and the reversed funds are returned, you are not\r\nentitled to a refund or to have your account or subscription reinstated.</p>\r\n\r\n<p>a. Your subscription will continue\r\nindefinitely until canceled by you. After your initial subscription commitment\r\nperiod, and again after any subsequent subscription period, your subscription\r\nwill automatically continue for an additional equivalent period, at the price\r\nyou agreed to when subscribing. You agree that your account will be subject to\r\nthis automatic renewal feature. If you do not wish your account to renew\r\nautomatically, or if you want to change or terminate your subscription, please\r\n