> II.  By using the Website or the Service\r\nin any manner, you agree to the above arbitration agreement. You and I are\r\nentitled to a fair hearing before the arbitrator, and in doing so, <b>YOU\r\nGIVE UP YOUR RIGHT TO GO TO COURT</b> to assert or defend any claims\r\nbetween you and the Company (except for matters that may be taken to\r\nsmall-claims court). <b>YOU ALSO GIVE UP YOUR RIGHT TO PARTICIPATE IN A\r\nCLASS ACTION OR OTHER CLASS PROCEEDING</b>S. \r\nThe arbitrator can grant any relief that a court can, but you should note\r\nthat arbitration proceedings are usually simpler and more streamlined than\r\ntrials and other judicial proceedings. Note: For details on the arbitration\r\nprocess, see our <a target=\"_blank\" rel=\"nofollow\" href=\"http://www.match.com/registration/arbitrationProcedures.aspx\">Arbitration\r\nProcedures</a>.</p>\r\n\r\n<p>III.  If this arbitration agreement is for\r\nany reason held to be unenforceable, any litigation against the Company may be\r\ncommenced only in the federal or state courts located in Oakland County, MI.\r\nAny arbitration agreement enforcement, including any proceeding to vacate confirm,\r\nor alter, an arbitration award, may be commenced in any court of competent\r\njurisdiction. You hereby irrevocably consent to the jurisdiction of those\r\ncourts for such purposes.</p>\r\n\r\n<p>IV. This Agreement, and any dispute between\r\nyou and the Company shall be governed by the laws of the state of Michigan\r\nwithout regard to principles of conflicts of law, if this arbitration agreement\r\nshall be governed by the Federal Arbitration Act.</p><p><b>42.</b>  <b><u>Indemnity\r\n     by You</u></b></p>\r\n\r\n<p>The Company reserves the right to\r\nassume the exclusive defense and control of any matter otherwise subject to\r\nindemnification by you, in which event you will fully collaborate with the\r\nCompany in connection therewith. You agree to indemnify and hold the Company,\r\nits subsidiaries, and affiliates, and its officers, agents, partners and\r\nemployees, harmless from any loss, liability, claim, or demand, including\r\nreasonable attorney\'s fees, made by any third party due to or arising out of\r\nyour breach of or failure to comply with this Agreement (including any breach\r\nof your representations and warranties contained herein), any postings or the content you post on the Website or as a result of the Service, and the\r\nviolation of any law or regulation by you. Note: The Company may provide you\r\nwith notices, including those regarding changes to this Agreement, using any practical\r\nmeans now known or hereafter developed, including by email, regular mail, SMS,\r\nMMS, text message, or postings on the Website. Such notices may not be received\r\nif you violate this Agreement by accessing the Service in an unauthorized\r\nmanner. You agree that you are deemed to have received any and all notices that\r\nwould have been delivered had you accessed the Service in an authorized manner.</p>\r\n\r\n<p><b>42.</b>  <b><u>Entire\r\n     Agreement; Other</u></b></p>\r\n\r\n<p>This agreement, with the Privacy Policy and any precise guidelines or rules that are\r\nseparately posted for services containing the entire agreement between you and\r\nthe Company regarding the use of the Website and/or the Service. If any\r\nprovision of this Agreement is held invalid, the remainder of this Agreement\r\nshall continue in full force and effect. You agree that your online account is\r\nnon-transferable and all your rights to your profile or contents within your\r\naccount terminate upon your death. No agency, partnership, joint venture or\r\nemployment is created because of this Agreement and you may not make any\r\nrepresentations or bind the Company in any manner. The failure of the Company\r\nto exercise or enforce any right or provision of this Agreement shall not\r\nconstitute a waiver of such right or provision. </p>\r\n\r\n<p><b>43.</b>  <b><u>Amendment</u></b></p>\r\n\r\n<p>This Agreement is subject to change by the Company at any\r\ntime. If you are a non-subscribing Member at the time of any change, the\r\nrevised terms will be effective upon posting on the Website and your use of the\r\nService after such posting will constitute acceptance by you of the revised\r\nAgreement. If you are a subscribing Member at the time of any change, then the existing agreement will continue to govern your membership until such time that you\r\nrenew your subscription as contemplated by Section 12. If you continue your\r\nsubscription, your renewal will constitute acceptance by you of the revised\r\nAgreement. Alternatively, if you terminate your subscription at such time, your\r\nuse of the Service after your termination will constitute acceptance by you of\r\nthe Agreement.</p><p><b>44.</b>  <b><u>Special State Terms</u></b></p>\r\n\r\n<p>The\r\nfollowing provisions are added to this Agreement for subscribers residing in\r\nArizona, California, Connecticut, Illinois, Iowa, Minnesota, New York, North\r\nCarolina, Ohio, and Wisconsin:</p>\r\n\r\n<p><b>You, the buyer, may cancel this agreement, without penalty\r\nor obligation, at any time prior to midnight of the third business day\r\nfollowing the original date of this contract, excluding Sundays and holidays.\r\nTo cancel this agreement, mail or deliver a signed and dated notice which\r\nstates that you, the buyer, are canceling this agreement, or words of similar effect.\r\nThis notice shall be sent to Matchmadeinjannah.com, Attn: Cancellations, </b><b>P.O. Box\r\n214752, Auburn Hills, MI 48321-4752.\r\nPlease include your matchmadeinjannah.com username and email address in any\r\ncorrespondence or your refund may be delayed. If you cancel, Matchmadeinjannah.com\r\nwill return, within ten days of the date on which you give notice of\r\ncancellation of any payments you have made. If you send or deliver the notice\r\nto cancel your subscription agreement within such three-day period, we will\r\nrefund the full amount of your subscription.</b></p>\r\n\r\n<p><b>In the event that you die before the end of your\r\nsubscription period, your estate shall be entitled to a refund of that portion\r\nof any payment, you had made for your subscription which is allocable to the period after your death. In the event that you become disabled (such that you\r\nare unable to use the services of Matchmadeinjannah.com) before the end of your\r\nsubscription period, you shall be entitled to a refund of that portion of any payment you had made for your subscription which is allocable to the period\r\nafter your disability by providing the company notice at the same address as\r\nlisted above.</b></p>\r\n\r\n<p>Please <a target=\"_blank\" rel=\"nofollow\" href=\"http://www.matchmadeinjannah.com\">Contact Us</a> with any questions regarding this agreement to customers@matchmadeinjannah.com.</p>');
