(47, 'privacy_policy', '<p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p><b> </b></p>\r\n\r\n<div>\r\n\r\n\r\n\r\n</div>\r\n\r\n<p><b><u>This Privacy Policy will be effective </u></b><b><u>from</u></b><b><u> July 1, 2019</u></b></p>\r\n\r\n<p>At Match Made In Jannah when you provide us\r\nwith your personal information, your privacy becomes our topmost priority.  W<strong>e work hard to keep your information\r\nsecure with us. </strong>We update our security practices to enhance the\r\nsafety of your information.  Our team\r\nmembers work hard in keeping your data safe and secure.</p>\r\n\r\n<p>Thank you for trusting us with your personal\r\ninformation!  We have written this\r\n“Privacy Policy”, as simple as possible so that you may understand the basics\r\nof the information, we collect, collect it the reasons behind it, and how we use\r\nit, as follows:</p>\r\n\r\n<p><b>    I.     </b><b><u>THE INFORMATION\r\nYOU GIVE US</u></b><b><u></u></b></p>\r\n\r\n<p>When you choose Match Made In Jannah’s services, you\r\nchoose to give us certain information which includes: </p>\r\n\r\n<p>·      \r\nTo\r\ncreate your account, you provide us with your login credentials, as well as necessary\r\nbasic details such as gender and date of birth.</p>\r\n\r\n<p>·       When you fill out\r\nthe profile questionnaire, you share additional data with us, such as Personal\r\nDetails, Appearance, Education & Career, Religion, and Spouse Preference as\r\nwell as photos and/or videos.  When you add\r\ncontent like pictures or videos, you give access to your camera or photo\r\nalbum. Sometimes,  the data you provide\r\nus could be considered “special” or “sensitive” in certain jurisdictions, such\r\nas racial or ethnic origins, sexual orientation, and religious beliefs. By\r\nchoosing to provide this information to us, you give us consent to process the\r\ninformation.</p><p>We monitor or\r\nrecord the interactions we have with you for training or security purposes and\r\nto ensure a high quality of service.  So,\r\nwhen you have any concerns, please contact our <u>Customer Care team,</u> and\r\nwe will try our best to guarantee your satisfaction.</p>\r\n\r\n<p><b>  \r\nII.     </b><b><u>INFORMATION\r\nWE RECEIVE FROM OTHERS</u></b><b><u></u></b></p>\r\n\r\n<p>There are times when we will receive information about you\r\nfrom others.</p>\r\n\r\n<p><b>A. </b>  \r\n<b>Other</b><b> </b><b>Users</b><br>\r\nWe may\r\ncollect information about you from other users if they contact us about you.\r\nAlso, if and when, a user asks us to access contacts from his/her phonebook and\r\nyou happen to be one of those, we may use it to reach out to you on behalf of\r\nthe user.</p>\r\n\r\n<p><b>B.    </b><b>Social Media</b><b></b></p>\r\n\r\n<p>You may be able to use your social media\r\nlogin (Facebook Login) to create and log into your Match Made In Jannah account.\r\nThis saves you from having to remember yet another user name and password and\r\nallows you to share some information from your social media account with us.</p>\r\n\r\n<p> <b>\r\nIII. </b>    <b><u>INFORMATION\r\nWE GATHER</u></b></p>\r\n\r\n<p>Whenever you access our services through a\r\nsocial media account, we collect information generated through access logs,\r\nthird parties, as well as basic profile details. </p>\r\n\r\n<p><b>  IV.     </b><b><u>INFORMATION\r\nGATHERED WHEN YOU USE OUR SERVICES</u></b><b><u></u></b></p>\r\n\r\n<p>When you use our services, we collect information\r\nabout which features you’ve used, how you’ve used them and the devices you use\r\nto access our services, for example:</p>\r\n\r\n<h2><small>A.   \r\nUsage Information</small></h2>\r\n\r\n<p>We collect\r\ninformation about your activities on our services, for instance, how you use\r\nthem (e.g., the date & time you logged in, the features you’ve used,\r\nsearches click as well as pages which have been shown to you, referring\r\nwebpage address, advertising that you click on) and how you interact with other\r\nusers (e.g., users you connect and interact with, time and date of your\r\nexchanges, the number of messages you sent and have received).</p>\r\n\r\n<h2><small>B.   \r\nDevice Information</small></h2>\r\n\r\n<p>We collect information from and about the\r\ndevice(s) you use to access our services, as well as:</p>\r\n\r\n<p>·      \r\nhardware and software information such as IP\r\naddress, device ID and type, device-specific and apps settings and\r\ncharacteristics, app crashes, advertising IDs (such as Google’s AAID and\r\nApple\'s IDFA, both of which are randomly generated numbers that you can reset\r\nby going into your device’ settings), browser type, version, and language, the operating system, time zones, identifiers associated with cookies or other\r\ntechnologies that may uniquely identify your device or browser (e.g., IMEI/UDID\r\nand MAC address).</p>\r\n\r\n<p>·      \r\ninformation on your wireless and mobile\r\nnetwork connection.</p>\r\n\r\n<p>·      \r\ninformation on device sensors such as gyroscopes,\r\ncompasses, and accelerometers.</p>\r\n\r\n<h2><small>C.   \r\nAdditional Information With Your Permission</small></h2>\r\n\r\n<p>If you give us\r\npermission, only then, we can collect your geolocation (latitude & longitude)\r\nthrough various means, depending on the service and device you’re using,\r\nincluding GPS, Bluetooth, or Wi-Fi connections. The collection of your\r\ngeolocation may occur in the background even when you aren’t using the\r\nservices. We will not collect your geolocation, without your permission.  Likewise, with your consent, we may collect\r\nyour photos/videos.</p>\r\n\r\n<h2><b><small></small></b><b><small>D.   </small></b><b><small>How </small></b><b><small>& Why </small></b><b><small>We Use </small></b><b><small>Your </small></b><b><small>Information</small></b><b><small></small></b></h2>\r\n\r\n<p>The main purpose we\r\nuse your information is to deliver and improve our services, and having the objective\r\nto use your information which in turn will help you be safe. </p>\r\n\r\n<h2><small>E.    </small><b><small>How We\r\n</small></b><b><small>Administer </small></b><b><small>Your</small></b><b><small> Account </small></b><b><small>&</small></b><b><small> Provide </small></b><b><small>Our </small></b><b><small>Services To You</small></b></h2>\r\n\r\n<p>·       Create and manage\r\nyour account.</p>\r\n\r\n<p>·       Provide you with\r\ncustomer support and respond to your requests.</p>\r\n\r\n<p>·       Complete your\r\ntransactions.</p>\r\n\r\n<p>·       Communicate with\r\nyou about our services, including order management and billing.</p>\r\n\r\n<h2><small>F.    </small><b><small>To Help You Connect With Other Users</small></b></h2>\r\n\r\n<p>·       We analyze your\r\nprofile as well as other users’ to recommend meaningful connections.</p>\r\n\r\n<p>·       Show your profile\r\nto other users.</p>\r\n\r\n<h2><small>G.    </small><b><small>To Ensure A Consistent Experience Across Your\r\nDevices</small></b></h2>\r\n\r\n<p>We link\r\nvarious devices you use so that you can enjoy a consistent experience of our\r\nservices on all of them. We do this by linking devices and browser data, such\r\nas when you log into your account on different devices or by using partial or\r\nfull IP address, browser version and similar data about your devices to help\r\nidentify and link them.</p>\r\n\r\n<h2><small>H.    </small><b><small>To Improve Our Services </small></b><b><small>&</small></b><b><small> Develop New Ones</small></b></h2>\r\n\r\n<p>·       Administer focus\r\ngroups and surveys.</p>\r\n\r\n<p>·      \r\nDevelop\r\nnew features and services (for example, we may decide to build a new interests-based feature further to requests received from users).</p>\r\n\r\n<p>·      \r\nConduct\r\nresearch and analysis of users’ behavior to improve our services and content\r\n(for instance, we may decide to change the look and feel or even substantially\r\nmodify a given feature based on users’ behavior).</p>\r\n\r\n<small></small><h2><small>I.    </small><b><small>To Prevent, Detect & Fight Fraud Or Other\r\nIllegal Or Unauthorized Activities</small></b></h2>\r\n\r\n<p>·      Perform data\r\nanalysis to better understand and design countermeasures against these\r\nactivities.</p>\r\n\r\n<p>·       Address ongoing or\r\nalleged misbehavior on and off-platform.</p>\r\n\r\n<p>·       Retain data\r\nrelated to fraudulent activities to prevent recurrences.</p>\r\n\r\n<h2><small>J.      </small><b><small>To Ensure Legal Compliance</small></b></h2>\r\n\r\n<p>·       Assist law\r\nenforcement.</p>\r\n\r\n<p>·       Comply with legal\r\nrequirements.</p>\r\n\r\n<p>·       Enforce or\r\nexercise our rights, for example, our Terms and Conditions.</p>\r\n\r\n<p>  <b><u>WE\r\nDEPEND ON THESE FOLLOWING LEGAL BASES:</u></b></p>\r\n\r\n<p><b>1) </b>  \r\n<b><u>How We </u></b><b><u>Provide Our Service To You</u></b><br>\r\nMajority of\r\nthe time, we process your information to perform the contract that you have\r\nwith us. For example, as you go about using our service to build meaningful\r\nconnections, we use your information to maintain your account as well as your\r\nprofile, to make it viewable to other users and recommend other users to you.</p>\r\n\r\n<p><b>2)</b>    <b><u>Legitimate Interests</u></b><br>\r\nWe may use\r\nyour information where we have legitimate interests to do so. For instance, we analyze\r\nusers’ behavior on our services to continuously improve our offerings, we\r\nsuggest offers we think might interest you, and we process information for\r\nadministrative, fraud detection and other legal purposes. </p>\r\n\r\n<p><b>3)   </b><b><u>How We Share Information</u></b></p>\r\n\r\n<p>Since our goal is to help you make meaningful\r\nconnections, the main sharing of users’ information is with other users. We\r\nalso share some users’ information with service providers and partners who\r\nassist us in operating the services, and in some cases, legal authorities.</p>\r\n\r\n<p><b>4)   \r\n</b><b><u>With</u></b><b><u> </u></b><b><u>Other</u></b><b><u> Users</u></b><b><u></u></b></p>\r\n\r\n<p>Please be careful with your information and make sure\r\nthat the content you share is the stuff that you’re comfortable being publicly\r\nviewable since neither you nor we can control what others do with your\r\ninformation once you share it.  If you\r\nchoose to limit the audience for all or part of your profile or for certain\r\ncontent or information about you, then it will be visible according to your\r\nsettings.</p>\r\n\r\n<p><b>5)</b>   \r\n<b><u>For\r\nCorporate Transactions</u></b><b><br>\r\n</b>We\r\nmay transfer your information if we are involved, whether in whole or in part,\r\nin a merger, sale, acquisition, divestiture, restructuring, reorganization,\r\ndissolution, bankruptcy, or other change of ownership or control.</p>\r\n\r\n<p><b>6)</b>   \r\n<b><u>When\r\nRequired By Law</u></b><br>\r\nWe may disclose\r\nyour information is reasonably necessary: (i) to comply with a legal process,\r\nsuch as a court order, subpoena or search warrant, government law enforcement the investigation, or other legal requirements; (ii) to assist in the prevention or\r\ndetection of a crime (subject in each case to be applicable by law); or (iii)\r\nto protect the safety of any person.</p>\r\n\r\n<p><b>7)</b>   \r\n<b><u>To\r\nEnforce Legal Rights</u></b><b><br>\r\n</b>We\r\nmay also share information: </p><p>(a) as necessary to protect our legal rights and\r\nlegal rights of our users.</p>\r\n\r\n<p>(b) to enforce our\r\nagreements with you; and (c) to investigate, prevent, or take other action\r\nregarding illegal activity, suspected fraud or other wrongdoing (d) if\r\ndisclosure would mitigate our liability in an actual or threatened lawsuit.</p>\r\n\r\n<p><b>8)</b>    <b><u>With Your Consent Or At Your Request</u></b><br>\r\nWe may ask\r\nfor your consent to share your information with third parties.  We will always make it clear why we want to\r\nshare the information. We may use and share non-personal information (meaning\r\ninformation that doesn’t identify who you are such as general demographics,\r\ngeneral behavioral data, device information, geolocation in de-identified\r\nform), under any of the above circumstances. We may combine this information\r\nwith additional non-personal information or personal information in hashed,\r\nnon-human readable form collected from other sources.</p>\r\n\r\n<p><b>9) </b>  \r\n<b><u>Cross-Border Information Transfers</u></b></p>\r\n\r\n<p>Delivery of information laid out in Section 6\r\nsometimes includes cross-border data transfers, for instance to the United States of America and other jurisdictions. As an example, where the service permits users to be located in the European Economic Area (“EEA”), their private\r\ninformation is transported to countries outside of the EEA. We use standard\r\ncontract clauses acknowledged by the European Commission or other suitable\r\nsafeguards to permit data transfers from the EEA to other countries. \r\nStandard contractual clauses are commitments between companies transferring\r\npersonal data, binding them to protect the privacy and security of your data.</p>\r\n\r\n<h2>  <small>  K.     </small><b><u><small>YOUR </small></u></b><b><u><small>PRIVACY\r\n</small></u></b><b><u><small>RIGHTS</small></u></b><u></u></h2>\r\n\r\n<p>You should always be in\r\ncontrol of your information, so we provide you with the following tools:</p><p><b>1. </b>  \r\n<b>Access/Update\r\nTools In The Servic</b><b>e</b></p>\r\n\r\n<p>Tools and account settings that help you to access, resolve, or remove information that you provided to us, which is associated with your\r\naccount directly within the service. If you have any question on those tools\r\nand settings, please contact our customer care team for help.</p>\r\n\r\n<p><b>2.</b>   \r\n<b>Reviewing\r\nYour Information</b><br>\r\nApplicable\r\nprivacy laws may give you the right to review your personal information we keep\r\nabout you. You can request a copy of your personal information by writing to us.  If you think that the information we have\r\nabout you is wrong and want to appeal on its’ alteration or deletion, please\r\ncontact us in writing.  You will be asked\r\nto provide proof of identity before we can answer the above requests, for your\r\nas well as other users\' protection. \r\nCertain requests will not accommodate certain objections, such as no\r\nshow of birth date.  In this case, we\r\ncannot provide our services.</p>\r\n\r\n<p><b>3. </b>  \r\n<b>Uninstall\r\n</b><b>Thru App</b></p>\r\n\r\n<p>You can stop all\r\ninformation assembly by an app, by using the standard uninstall process for\r\nyour device. If you uninstall the app through your mobile, the unique identifier\r\nassociated with your device will continue to be stored. </p>\r\n\r\n<p><b>4.</b>   \r\n<b>Accountability</b><br>\r\nIn certain\r\ncountries, including in the European Union, you have a right to lodge a\r\ncomplaint with the appropriate data protection authority, if you have concerns\r\nabout your personal information.  You can\r\ncontact data protection authority, and there could be possibilities that you\r\nmay connect with someone of your habitual residence, where you work or where we\r\nare established.</p>\r\n\r\n<p>Please provide\r\nproof of your identity for account management purposes, failure to provide\r\nsuitable ID may result in the suspension or removal of your account as outlined\r\nwithin our site terms and conditions.</p>\r\n\r\n<p><b>5.  </b> \r\n<b>Proof\r\nOf Identity </b><b>Process</b><br>\r\nOur Senior\r\naccount manager deletes all documents provided for proof of immediately after\r\nuse.</p>\r\n\r\n<p><b> 6.     </b><b><u>THE\r\nSTEPS WE TAKE TO PROTECT YOUR INFORMATION</u></b><b><u></u></b></p>\r\n\r\n<p>We work\r\nhard to protect you from unlawful access to your personal information. \r\nWhile we take the utmost steps to secure your information, we do not guarantee,\r\nand you should not assume, that your personal information will always remain\r\nsecure.</p>\r\n\r\n<p>We frequently\r\nmonitor our systems for possible vulnerabilities and assaults, and regularly\r\nreview our information collection, storage, and processing practices to update\r\nour security measures.  If you believe\r\nthat your account or information is no longer secure, please notify us\r\nimmediately.</p>\r\n\r\n<p>If we at\r\nany time detect/suspect any breach of security, we may suspend your use\r\npart or all of the services without notice to you.  </p>\r\n\r\n<p><b>7. </b>   \r\n<b><u>HOW LONG WE RETAIN YOUR INFORMATION</u></b><u></u></p>\r\n\r\n<p>We keep your personal information only as long as we\r\nneed it for legitimate business purposes and as permitted by applicable law.</p>\r\n\r\n<p>a.     We keep specific\r\ndata as evidence of our compliance, such as records of consents to our Terms\r\nand Conditions, Privacy, and Security Policy are kept for five (5)years.</p>\r\n\r\n<p>b.     We keep all data,\r\njust in case there is an outstanding issue, claim, and/or dispute requiring us\r\nto keep the relevant information until it is resolved.</p>\r\n\r\n<p>Some of the information must be kept for our legitimate business interests, such as fraud\r\nprevention and enhancing users\' safety and security. <u></u></p>\r\n\r\n<p>8.    \r\n<b><u>JUVENILES\' DISCRETION</u></b><u></u></p>\r\n\r\n<p>Our services are\r\nrestricted to users who are only18 yrs. or older.  If you suspect that a user is under the age of\r\n18 yrs., please use the reporting mechanism available through the service.</p>\r\n\r\n<p> 9.    \r\n<b><u>PRIVACY POLICY CHANGES</u></b><u></u></p>\r\n\r\n<p>We’re always considering new and\r\ninnovative ways to help you build meaningful connections with us, so this policy could change over time.</p><p>10.     <b><u>HOW\r\nTO CONTACT US</u></b></p><p><u></u></p>\r\n\r\n<p>Match Made In Jannah                                 Customer: customers@matchmadeinjannah.com</p>\r\n\r\n<p>P.O. Box 214752                                            Technical Support: techelp@matchmadeinjannah.com</p><p>Auburn Hills, MI 48326                                 Phone:\r\n(248) 934-0075   (Monday -\r\nFriday, 9 am - 5 pm EST)</p>\r\n\r\n<p>  </p><p></p>'),
