(11, 'Shabir & Nargis', 'Shabir & Nargis got married a month after they met at Match Made In Jannah.', '[{\"index\":0,\"img\":\"happy_story_11_1.jpg\",\"thumb\":\"happy_story_11_1_thumb.jpg\"}]', 'Nargis', 66, '2019-04-12 02:29:05', 1),
(12, 'Zamir & Rahat', 'Zamir & Rahat met at Match Made In Jannah, they clicked and tied the knot.', '[{\"index\":0,\"img\":\"happy_story_8_2.jpg\",\"thumb\":\"happy_story_8_2_thumb.jpg\"}]', 'Rahat', 65, '2019-06-12 05:49:26', 1),
